import ALLMUPS from './pages/ALLmeetups';
import NewMeetupPage from './pages/NewMeetup';

function App() {
  return (
  <div >
    <Route path='/'>
      <ALLMUPS></ALLMUPS>
    </Route>

    <Route>
      <NewMeetupPage></NewMeetupPage>
    </Route>


  </div>
  );
}

export default App;
